import { world_map } from './world_map.ts';
import { population_density } from './data.ts';
import * as React from "react";
import * as ReactDOM from "react-dom";
import { MapsComponent, LayersDirective, LayerDirective } from '@syncfusion/ej2-react-maps';
const map = ReactDOM.render(
        <MapsComponent id="maps">
            <LayersDirective>
                <LayerDirective shapeData={world_map} shapeDataPath='name' shapePropertyPath='name' dataSource={population_density} shapeSettings={{
    colorValuePath: 'density',
    fill: '#E5E5E5',
    colorMapping: [
        {
            from: 0.00001, to: 100, color: 'rgb(153,174,214)'
        },
        {
            from: 100, to: 200, color: 'rgb(115,143,199)'
        },
        {
            from: 200, to: 300, color: 'rgb(77,112,184)'
        },
        {
            from: 300, to: 500, color: 'rgb(38,82,168)'
        },
        {
            from: 500, to: 19000, color: 'rgb(0,51,153)'
        }
    ]
}}>
    <div style="position:fixed;top:0;left:0;right:0;font-family:&quot;Segoe UI&quot;;font-size:16px;background:repeating-linear-gradient(45deg,#d70f0f,#d70f0f 10px,#e12121 10px,#e12121 17px);color:#ffffff;z-index:999999999;text-align:center;padding:10px 50px 10px 25px;" id="js-licensing">This application was built using a trial version of Syncfusion Essential Studio. Please include a valid license to permanently remove this license validation message. You can also obtain a free 30 day evaluation license to temporarily remove this message during the evaluation period. Please refer to this <a class="e-license" href="https://help.syncfusion.com/common/essential-studio/licensing">help topic</a> for more information.<span id="license-banner-event" class="e-license-banner"><svg xmlns="http://www.w3.org/2000/svg" width="20" height="20"><line x1="5" y1="5" x2="15" y2="15" stroke="yellow" stroke-width="2.5" stroke-miterlimit="10" stroke-linecap="round"></line><line x1="15" y1="5" x2="5" y2="15" stroke="yellow" stroke-width="2.5" stroke-linecap="round" stroke-miterlimit="10"></line></svg></span></div>

                </LayerDirective>
            </LayersDirective>
        </MapsComponent>, document.getElementById("maps"));

export default map;
